import {API} from "../constants";
import {showAlertFail} from "./alertAction";
import Axios from "axios";
import headerHelper from "../helpers/headerHelper";

export const getBillRequest = () => {
  return async (dispatch) => {
    try {
      const response = await Axios.post(API.REQUEST.GET_BILL_REQUEST, null, headerHelper);
      console.log(response);
      dispatch(showAlertFail(response));
    } catch (e) {
      dispatch(showAlertFail(e));
    }
  }
}
